import logo from '../logo.svg';
import '../App.css';
import { Link } from 'react-router-dom';


export function Home() {
    return (
        <>
            <Navbar/>
            <h2>Boton importado de la carpeta Components.</h2>
            <MyButton/>
            <h2>Bot√≥n creado desde App.js</h2>
            <MyOtherButton />
            <h2>Usando Links de React Router</h2>
            <Link to="/Home">Home</Link>
            <Link to="/Enlace1">Enlace 1</Link>
            <Link to="/Enlace2">Enlace 2</Link>
        </>
    )
}
